function HeroSubSection({ text }){
  return(
     <div className="column" >
            <p className="text-left">
            {text}
            </p>        
    </div>
  )
}


function HeroSection(){
  return(
    <>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-4">

      <HeroSubSection text={`Fully indemnifiable notes for the ultimate defense against litigation in just seconds through patient-personalised suggestions that don't require a single keystroke.`}          
            />

      <HeroSubSection text={`TapNote is an intelligent system that helps you get your <span class="highlight">notes done 80% faster with legal accuracy</span> while fully educating the patient.`}
      />

      </div>

    </>
  )

}

function Hero() {
  return (
    <>

     <section className="top-hero mt-4 md:mt-12">

      <h1 className="text-center pb-2">Tapnote</h1> 
      <h3 className="text-center pb-16 section-subhead">The reimagined Dental Record</h3>
      <HeroSection/>

    </section>

   </> 
  )
};


export default Hero;
